import React from "react";

const Signup = () => {
  return (
    // Making a FORM
    <>  
      <form method="post" >
        <input type="text" placeholder="E"/>
        <input type="email" placeholder="E"/>
        <input type="password" placeholder="E"/>
      </form>
    </>
  );
};

export default Signup;
